    <style>
      :root {
        --primary-color: #4e73df;
        --secondary-color: #1cc88a;
        --danger-color: #e74a3b;
        --background-color: #f8f9fc;
        --text-color: #5a5c69;
        --font-family: "Roboto", sans-serif;
        --border-radius: 8px;
        --transition-speed: 0.3s;
        --box-shadow: 0 4px 6px rgba(0, 0, 0, 0.1);
      }

      * {
        box-sizing: border-box;
        margin: 0;
        padding: 0;
      }

      body {
        font-family: var(--font-family);
        background-color: var(--background-color);
        color: var(--text-color);
        display: flex;
        justify-content: center;
        align-items: center;
        min-height: 100vh;
        padding: 20px;
      }

      .container {
        background-color: #ffffff;
        padding: 40px;
        border-radius: var(--border-radius);
        box-shadow: var(--box-shadow);
        max-width: 500px;
        width: 100%;
        text-align: center;
      }

      h1 {
        font-size: 2rem;
        color: var(--primary-color);
        margin-bottom: 10px;
      }

      p.subtitle {
        font-size: 1rem;
        color: #858796;
        margin-bottom: 30px;
      }

      .file-input {
        margin-bottom: 20px;
      }

      input[type="file"] {
        display: none;
      }

      .custom-file-label {
        display: inline-block;
        padding: 10px 20px;
        background-color: var(--primary-color);
        color: #fff;
        border-radius: var(--border-radius);
        cursor: pointer;
        transition: background-color var(--transition-speed);
      }

      .custom-file-label:hover {
        background-color: #375acb;
      }

      .checkbox-group {
        display: flex;
        justify-content: center;
        gap: 20px;
        margin: 20px 0;
      }

      .checkbox-group label {
        display: flex;
        align-items: center;
        font-size: 0.9rem;
        cursor: pointer;
        color: #4e5d6c;
      }

      .checkbox-group input {
        margin-right: 8px;
        width: 16px;
        height: 16px;
        cursor: pointer;
      }

      .btn {
        display: inline-block;
        padding: 12px 30px;
        font-size: 1rem;
        font-weight: 500;
        color: #fff;
        background-color: var(--primary-color);
        border: none;
        border-radius: var(--border-radius);
        cursor: pointer;
        transition: background-color var(--transition-speed),
          transform var(--transition-speed);
        margin: 10px 5px;
      }

      .btn:disabled {
        background-color: #d1d3e2;
        cursor: not-allowed;
      }

      .btn:hover:not(:disabled) {
        background-color: #375acb;
        transform: translateY(-2px);
      }

      .btn-secondary {
        background-color: var(--secondary-color);
      }

      .btn-secondary:hover {
        background-color: #17a673;
      }

      .status,
      .progress {
        font-size: 1rem;
        margin: 15px 0;
      }

      .qr-section {
        margin-top: 40px;
        padding: 20px;
        background-color: #f1f3f6;
        border-radius: var(--border-radius);
        box-shadow: var(--box-shadow);
      }

      footer {
        margin-top: 40px;
        font-size: 0.85rem;
        color: #adb5bd;
      }
    </style>
